        <img class="colelem" id="u17094-21" alt="Os integrantes do Elo Nacional aprovaram uma resolu√ß√£o que garante a emiss√£o das passagens a√©reas e terrestres para os membros da Comiss√£o Executiva e os delegados estaduais participarem do 2¬∫ Congresso da REDE, que acontece entre os dias 3 e 6 de mar√ßo em Bras√≠lia (DF). O objetivo √© garantir presen√ßa dos filiados no importante evento e, dessa forma, proporcionar um amplo debate sobre temas importantes. Entre esses assuntos, est√£o a revis√£o do estatuto, a an√°lise da conjuntura pol√≠tica e as pr√≥ximas elei√ß√µes municipais. O documento foi aprovado durante a reuni√£o extraordin√°ria do Elo Nacional, realizada no √∫ltimo fim de semana (dias 16 e 17 de janeiro). De acordo com a resolu√ß√£o n¬∫ 01/2016, as passagens ser√£o custeadas pela Coordena√ß√£o de Finan√ßas da REDE, atrav√©s dos recursos vindos por meio do Fundo Partid√°rio. Para obter esse aux√≠lio, a decis√£o dos integrantes do Elo Nacional tamb√©m prev√™ crit√©rios previstos na resolu√ß√£o. Os delegados dos estados cujas capitais ficam a mais de 1.250 quil√¥metros de Bras√≠lia ter√£o direito ao bilhete a√©reo. Abaixo dessa dist√¢ncia, a passagem poder√° ser a√©rea ou terrestre. Nesse caso, a op√ß√£o ser√° a de menor custo. Ainda segundo o documento, os delegados que quiserem utilizar ajuda dever√£o estar obrigatoriamente filiados no sistema FiliaWeb do TSE (Tribunal Superior Eleitoral) e em dia com as suas contribui√ß√µes √† REDE. Os interessados podem fazer essa verifica√ß√£o quanto a esses pagamentos junto ao partido. Para isso, basta entrar em contato no telefone (61) 3322-5436, sempre de segunda √† sexta-feira, das 14h √†s 18h. O prazo para delegados e integrantes da Comiss√£o Executiva Nacional se inscreverem e obterem esse aux√≠lio se estende at√© as 23h59 da pr√≥xima ter√ßa-feira, 26 de janeiro. O per√≠odo n√£o sofrer√° prorroga√ß√£o. Caso isso n√£o seja cumprido, o translado at√© o congresso ser√° de responsabilidade dos pr√≥prios delegados, desde que os elos estaduais tenham informado devidamente os procedimentos necess√°rios. Se as informa√ß√µes n√£o tenham chegado at√© os delegados e os prazos foram perdidos, a responsabilidade dos custos ficar√° por conta dos respectivos elos estaduais, conforme previsto na resolu√ß√£o aprovada pelo Elo Nacional. O documento destaca ainda que as despesas com alimenta√ß√£o e hospedagem n√£o ser√£o custeadas pelo Congresso da REDE. " width="920" height="633" src="images/u17094-21.png"/><!-- rasterized frame -->
